import React from "react";
import Home from "./Home";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <Router>
      <Route path="/" exact component={Home} />
      <Route path="/blog" exact component={TodosList} />
      <Route path="/blog/edit/:id" component={EditTodo} />
      <Route path="/blog/create" component={CreateTodo} />
        <Home />
      </Router>
    </div>
  );
}

export default App;
